INSERT INTO `ps_category_lang` VALUES ('4', '1', 'Laptops', 'The latest Intel processor, a bigger hard drive, plenty of memory, and even more new features all fit inside just one liberating inch. The new Mac laptops have the performance, power, and connectivity of a desktop computer. Without the desk part.', 'laptops', 'Apple laptops', 'Apple laptops MacBook Air', 'Powerful and chic Apple laptops');
INSERT INTO `ps_category_lang` VALUES ('4', '2', 'Portables', 'Le tout dernier processeur Intel, un disque dur plus spacieux, de la mmoire  profusion et d\'autres nouveauts. Le tout, dans  peine 2,59 cm qui vous librent de toute entrave. Les nouveaux portables Mac runissent les performances, la puissance et la connectivit d\'un ordinateur de bureau. Sans la partie bureau.', 'portables-apple', 'Portables Apple', 'portables apple macbook air', 'portables apple puissants et design');
INSERT INTO `ps_category_lang` VALUES ('4', '3', 'Porttiles', 'El ltimo procesador Intel, un disco duro ms grande, con profusin de memoria y otras novedades. Todo en slo 2,59 cm libres de cualquier obstruccin. Las nuevas porttiles Mac cumplir rendimiento, potencia y conectividad de una computadora de escritorio. Sin la parte del escritorio.', 'portatiles-apple', 'Porttiles Apple', 'porttiles apple macbook air', 'porttiles apple poderoso y el diseo');
INSERT INTO `ps_category_lang` VALUES ('4', '4', 'Laptops', 'The latest Intel processor, a bigger hard drive, plenty of memory, and even more new features all fit inside just one liberating inch. The new Mac laptops have the performance, power, and connectivity of a desktop computer. Without the desk part.', 'laptops', 'Apple laptops', 'Apple MacBook Air-Laptops', 'Powerful and chic Apple laptops');
INSERT INTO `ps_category_lang` VALUES ('4', '5', 'Laptop', 'L\'ultimissimo processore Intel, hard drive pi ampio, moltissima memoria, e ancora pi funzioni tutte inserite in 2,54 centimetri. I nuovi laptop Mac offrono le prestazioni, la potenza e la connettivit di un computer da tavolo. Senza bisogno del tavolo.', 'laptop', 'laptop Apple', 'laptot Apple MacBook Air', 'Laptop Apple potenti ed eleganti');
