INSERT INTO `ps_product_lang` VALUES ('1', '1', '<p><strong><span style=\"font-size: small;\">Curved ahead of the curve.</span></strong></p>\r\n<p>For those about to rock, we give you nine amazing colors. But that\'s only part of the story. Feel the curved, all-aluminum and glass design and you won\'t want to put iPod nano down.</p>\r\n<p><strong><span style=\"font-size: small;\">Great looks. And brains, too.</span></strong></p>\r\n<p>The new Genius feature turns iPod nano into your own highly intelligent, personal DJ. It creates playlists by finding songs in your library that go great together.</p>\r\n<p><strong><span style=\"font-size: small;\">Made to move with your moves.</span></strong></p>\r\n<p>The accelerometer comes to iPod nano. Give it a shake to shuffle your music. Turn it sideways to view Cover Flow. And play games designed with your moves in mind.</p>', '<p>New design. New features. Now in 8GB and 16GB. iPod nano rocks like never before.</p>', 'ipod-nano', '', '', '', 'iPod Nano', 'In stock', '');
INSERT INTO `ps_product_lang` VALUES ('1', '2', '<p><span style=\"font-size: small;\"><strong>Des courbes avantageuses.</strong></span></p>\r\n<p>Pour les amateurs de sensations, voici neuf nouveaux coloris. Et ce n\'est pas tout ! Faites l\'exprience du design elliptique en aluminum et verre. Vous ne voudrez plus le lcher.</p>\r\n<p><strong><span style=\"font-size: small;\">Beau et intelligent.</span></strong></p>\r\n<p>La nouvelle fonctionnalit Genius fait d\'iPod nano votre DJ personnel. Genius cre des listes de lecture en recherchant dans votre bibliothque les chansons qui vont bien ensemble.</p>\r\n<p><strong><span style=\"font-size: small;\">Fait pour bouger avec vous.</span></strong></p>\r\n<p>iPod nano est quip de l\'acclromtre. Secouez-le pour mlanger votre musique. Basculez-le pour afficher Cover Flow. Et dcouvrez des jeux adapts  vos mouvements.</p>', '<p>Nouveau design. Nouvelles fonctionnalits. Dsormais en 8 et 16 Go. iPod nano, plus rock que jamais.</p>', 'ipod-nano', '', '', '', 'iPod Nano', 'En stock', '');
INSERT INTO `ps_product_lang` VALUES ('1', '3', '<p><strong>Curvas aerodinmicas.</strong></p>\r\n<p>Para los aficionados a las sensaciones fuertes, os presentamos nueve nuevos colores.  Y eso no es todo ! Experimenta el diseo elptico de aluminio y vidrio.  No querrs separarte de l nunca ms !</p>\r\n<p><strong><br /> Esttico e inteligente.</strong></p>\r\n<p>La nueva aplicacin Genius hace de iPod nano tu discjockey personal. Genuis crea listas de lectura buscando en tu biblioteca las canciones que combinan entre si.</p>\r\n<p><strong><br /> Hecho para moverse contigo.</strong><br /> iPod nano est equipado de un acelermetro. Muvelo para mezclar tu msica. Voltalo para mostrar Cover Flow. Y descubre juegos adaptados a tus movimientos.</p>', '<p>Nuevo diseo. Nuevas aplicaciones. Ahora disponible en 8 y 16 Go. iPod nano, ms rock que nunca.</p>', 'ipod-nano', '', '', '', 'iPod Nano', 'Disponible', '');
INSERT INTO `ps_product_lang` VALUES ('1', '4', '<p><span style=\"font-size: small;\">Immer eine Kurve voraus.</span></p>\r\n<p>Fr all die, die gleich losrocken wollen, gibt es jetzt neun tolle Farben zur Auswahl. Aber das ist nur ein Teil der Geschichte. Mit seinem runden Design, das komplett aus Aluminium und Glas besteht, werden Sie den iPod nano nicht mehr weglegen wollen.</p>\r\n<p><span style=\"font-size: small;\">Tolles Design. Und viel Kpfchen.</span></p>\r\n<p>Die neue Genius-Funktion verwandelt den iPod nano in Ihren hoch intelligenten, persnlichen DJ. Es erstellt Abspiellisten aus den Songs in Ihrer Sammlung, die gut zusammenpassen.</p>\r\n<p><span style=\"font-size: small;\">Passt sich Ihren Bewegungen an.</span></p>\r\n<p>Der iPod nano jetzt mit Beschleunigungsmesser. Einmal schtteln, und Ihre Musik wird neu sortiert. Kippen Sie es zur Seite fr die Cover Flow-Ansicht. Und spielen Sie mit den Bewegungen, an die Sie denken.</p>', '<p>New design. New features. Now in 8GB and 16GB. iPod nano rocks like never before.</p>', 'ipod-nano', '', '', '', 'iPod Nano', 'In stock', '');
INSERT INTO `ps_product_lang` VALUES ('1', '5', '<p><strong><span style=\"font-size: small;\">Curve mozzafiato.</span></strong></p>\r\n<p>Per te che ami le sensazioni forti, ecco nove fantastici colori. Ma non  finito qui. Accarezza il design sinuoso fatto di vetro e alluminio dell\'iPod nano, e non lo lascerai pi.</p>\r\n<p><strong><span style=\"font-size: small;\">Bello e intelligente.</span></strong></p>\r\n<p>La nuova funzione Genius trasforma l\'iPod nano nel tuo DJ personale. Sa creare delle playlist andando a cercare nella libreria musicale le canzoni che stanno bene insieme.</p>\r\n<p><strong><span style=\"font-size: small;\">Fatto per muoversi con te.</span></strong></p>\r\n<p>L\'accelerometro  integrato all\'iPod nano. Scuotilo per dare uno shuffle alla tua musica. Ruotalo di lato per vedere il Cover Flow. E divertiti con i giochi adattati alle tue movenze.</p>', '<p>Nuovo design. Nuove funzioni. Adesso in 8GB e 16GB. iPod nano, forte come non mai.</p>', 'ipod-nano', '', '', '', 'iPod Nano', 'In magazzino', '');
INSERT INTO `ps_product_lang` VALUES ('1', '6', '<p><strong><span style=\"font-size: small;\">Curved ahead of the curve.</span></strong></p>\r\n<p>For those about to rock, we give you nine amazing colors. But that\'s only part of the story. Feel the curved, all-aluminum and glass design and you won\'t want to put iPod nano down.</p>\r\n<p><strong><span style=\"font-size: small;\">Great looks. And brains, too.</span></strong></p>\r\n<p>The new Genius feature turns iPod nano into your own highly intelligent, personal DJ. It creates playlists by finding songs in your library that go great together.</p>\r\n<p><strong><span style=\"font-size: small;\">Made to move with your moves.</span></strong></p>\r\n<p>The accelerometer comes to iPod nano. Give it a shake to shuffle your music. Turn it sideways to view Cover Flow. And play games designed with your moves in mind.</p>', '<p>New design. New features. Now in 8GB and 16GB. iPod nano rocks like never before.</p>', 'ipod-nano', '', '', '', 'iPod Nano', 'In stock', '');
INSERT INTO `ps_product_lang` VALUES ('2', '1', '<p><span style=\"font-size: small;\"><strong>Instant attachment.</strong></span></p>\r\n<p>Wear up to 500 songs on your sleeve. Or your belt. Or your gym shorts. iPod shuffle is a badge of musical devotion. Now in new, more brilliant colors.</p>\r\n<p><span style=\"font-size: small;\"><strong>Feed your iPod shuffle.</strong></span></p>\r\n<p>iTunes is your entertainment superstore. Its your ultra-organized music collection and jukebox. And its how you load up your iPod shuffle in one click.</p>\r\n<p><span style=\"font-size: small;\"><strong>Beauty and the beat.</strong></span></p>\r\n<p>Intensely colorful anodized aluminum complements the simple design of iPod shuffle. Now in blue, green, pink, red, and original silver.</p>', '<p>iPod shuffle, the worlds most wearable music player, now clips on in more vibrant blue, green, pink, and red.</p>', 'ipod-shuffle', '', '', '', 'iPod shuffle', 'In stock', '');
INSERT INTO `ps_product_lang` VALUES ('2', '2', '<p><span style=\"font-size: small;\"><strong>Un lien immdiat.</strong></span></p>\r\n<p>Portez jusqu\' 500 chansons accroches  votre manche,  votre ceinture ou  votre short. Arborez votre iPod shuffle comme signe extrieur de votre passion pour la musique. Existe dsormais en quatre nouveaux coloris encore plus clatants.</p>\r\n<p><span style=\"font-size: small;\"><strong>Emplissez votre iPod shuffle.</strong></span></p>\r\n<p>iTunes est un immense magasin ddi au divertissement, une collection musicale parfaitement organise et un jukebox. Vous pouvez en un seul clic remplir votre iPod shuffle de chansons.</p>\r\n<p><strong><span style=\"font-size: small;\">La musique en technicolor.</span></strong></p>\r\n<p>iPod shuffle s\'affiche dsormais dans de nouveaux coloris intenses qui rehaussent le design pur du botier en aluminium anodis. Choisissez parmi le bleu, le vert, le rose, le rouge et l\'argent d\'origine.</p>', '<p>iPod shuffle, le baladeur le plus portable du monde, se clippe maintenant en bleu, vert, rose et rouge.</p>', 'ipod-shuffle', '', '', '', 'iPod shuffle', 'En stock', '');
INSERT INTO `ps_product_lang` VALUES ('2', '3', '<p><strong>Un enlace inmediato.</strong><br /> <br /> Lleva hasta 500 canciones colgadas de tu manga, de tu cinturn o de tu pantaln. Presume con tu iPod shuffle como signo exterior de tu pasin por la msica. Ahora ya existen cuatro nuevos colores ms llamativos. <br /> <br /> <strong>Llena tu iPod shuffle.</strong><br /> <br /> iTunes es una enorme tienda dedicada a la diversin, una coleccin de msica organizada perfectamente y un jukebox. Con tan solo un clic puedes llenar tu iPod shuffle con canciones. <br /> <br /> <strong>La msica en tecnicolor. </strong><br /> <br /> iPod shuffle presenta nuevos colores vivos que realzan su diseo estilizado en aluminio anodizado. Elige entre azul, verde, rosa, rojo y el plateado de origen.</p>', '<p>iPod shuffle, el walkman ms porttil del mundo, ahora en azul, verde, rosa y rojo.</p>', 'ipod-shuffle', '', '', '', 'iPod shuffle', 'Disponible', '');
INSERT INTO `ps_product_lang` VALUES ('2', '4', '<p>style=\"font-size: small;\"&gt;<strong>Gleich festmachen.</strong></p>\r\n<p>Tragen Sie bis zu 500 Songs am rmel. Oder an Ihrem Grtel. Oder an Ihrer Sporthose. iPod shuffle ist ein Erkennungszeichen echter Musikfans. Jetzt in neuen, noch leuchtenderen Farben.</p>\r\n<p>style=\"font-size: small;\"&gt;<strong>Fttern Sie Ihren iPod shuffle.</strong></p>\r\n<p>iTunes ist Ihr Super-Store fr Unterhaltung. Es ist Ihre optimal organisierte Musik-Sammlung und Jukebox. Und Sie knnen Ihren iPod shuffle mit einem Klick laden.</p>\r\n<p>style=\"font-size: small;\"&gt;<strong>Die Schne und der Beat.</strong></p>\r\n<p>Das farbintensive eloxierte Aluminium ergnzt das schlichte Design des iPod shuffle. Jetzt in Blau, Grn, Rosa, Rot und klassischem Silber.</p>', '<p>iPod shuffle, the worlds most wearable music player, now clips on in more vibrant blue, green, pink, and red.</p>', 'ipod-shuffle', '', '', '', 'iPod shuffle', 'In stock', '');
INSERT INTO `ps_product_lang` VALUES ('2', '5', '<p><span style=\"font-size: small;\"><strong>Sempre attaccato.</strong></span></p>\r\n<p>Metti 500 canzoni in tasca. O nella cintura. O nei pantaloncini. iPod shuffle ti fa avere le canzoni sempre addosso. Adesso in colori pi nuovi e brillanti.</p>\r\n<p><span style=\"font-size: small;\"><strong>Ricarica il tuo iPod shuffle.</strong></span></p>\r\n<p>iTunes  il tuo superstore del divertimento. La tua raccolta musicale super organizzata, il tuo juke-box. E puoi ricaricare il tuo iPod shuffle con un click.</p>\r\n<p><span style=\"font-size: small;\"><strong>Musica coloratissima.</strong></span></p>\r\n<p>Complementi dai colori intensi in alluminio anodizzato: questo  il design semplice di iPod shuffle. Adesso in blu, verde rosa, rosso, e argento originale.</p>', '<p>iPod shuffle, il lettore musicale pi indossabile del mondo, adesso anche nelle tonalit pi vibranti di blu, verde, rosa e rosso.</p>', 'ipod-shuffle', '', '', '', 'iPod shuffle', 'In magazzino', '');
INSERT INTO `ps_product_lang` VALUES ('2', '6', '<p><span style=\"font-size: small;\"><strong>Instant attachment.</strong></span></p>\r\n<p>Wear up to 500 songs on your sleeve. Or your belt. Or your gym shorts. iPod shuffle is a badge of musical devotion. Now in new, more brilliant colors.</p>\r\n<p><span style=\"font-size: small;\"><strong>Feed your iPod shuffle.</strong></span></p>\r\n<p>iTunes is your entertainment superstore. Its your ultra-organized music collection and jukebox. And its how you load up your iPod shuffle in one click.</p>\r\n<p><span style=\"font-size: small;\"><strong>Beauty and the beat.</strong></span></p>\r\n<p>Intensely colorful anodized aluminum complements the simple design of iPod shuffle. Now in blue, green, pink, red, and original silver.</p>', '<p>iPod shuffle, the worlds most wearable music player, now clips on in more vibrant blue, green, pink, and red.</p>', 'ipod-shuffle', '', '', '', 'iPod shuffle', 'In stock', '');
INSERT INTO `ps_product_lang` VALUES ('5', '1', '<p>MacBook Air is nearly as thin as your index finger. Practically every detail that could be streamlined has been. Yet it still has a 13.3-inch widescreen LED display, full-size keyboard, and large multi-touch trackpad. Its incomparably portable without the usual ultraportable screen and keyboard compromises.</p><p>The incredible thinness of MacBook Air is the result of numerous size- and weight-shaving innovations. From a slimmer hard drive to strategically hidden I/O ports to a lower-profile battery, everything has been considered and reconsidered with thinness in mind.</p><p>MacBook Air is designed and engineered to take full advantage of the wireless world. A world in which 802.11n Wi-Fi is now so fast and so available, people are truly living untethered  buying and renting movies online, downloading software, and sharing and storing files on the web. </p>', 'MacBook Air is ultrathin, ultraportable, and ultra unlike anything else. But you dont lose inches and pounds overnight. Its the result of rethinking conventions. Of multiple wireless innovations. And of breakthrough design. With MacBook Air, mobile computing suddenly has a new standard.', 'macbook-air', '', '', '', 'MacBook Air', '', null);
INSERT INTO `ps_product_lang` VALUES ('5', '2', '<p>MacBook Air est presque aussi fin que votre index. Pratiquement tout ce qui pouvait tre simplifi l\'a t. Il n\'en dispose pas moins d\'un cran panoramique de 13,3 pouces, d\'un clavier complet et d\'un vaste trackpad multi-touch. Incomparablement portable il vous vite les compromis habituels en matire d\'cran et de clavier ultra-portables.</p><p>L\'incroyable finesse de MacBook Air est le rsultat d\'un grand nombre d\'innovations en termes de rduction de la taille et du poids. D\'un disque dur plus fin  des ports d\'E/S habilement dissimuls en passant par une batterie plus plate, chaque dtail a t considr et reconsidr avec la finesse  l\'esprit.</p><p>MacBook Air a t conu et labor pour profiter pleinement du monde sans fil. Un monde dans lequel la norme Wi-Fi 802.11n est dsormais si rapide et si accessible qu\'elle permet vritablement de se librer de toute attache pour acheter des vidos en ligne, tlcharger des logiciels, stocker et partager des fichiers sur le Web. </p>', 'MacBook Air est ultra fin, ultra portable et ultra diffrent de tout le reste. Mais on ne perd pas des kilos et des centimtres en une nuit. C\'est le rsultat d\'une rinvention des normes. D\'une multitude d\'innovations sans fil. Et d\'une rvolution dans le design. Avec MacBook Air, l\'informatique mobile prend soudain une nouvelle dimension.', 'macbook-air', '', '', '', 'MacBook Air', '', null);
INSERT INTO `ps_product_lang` VALUES ('5', '3', '<p>MacBook Air es casi tan fino como tu dedo. Se ha simplificado al mximo y a pesar de ello dispone de una pantalla panormica de 13,3 pulgadas, de un teclado completo y de un amplio trackpad multi-touch. Porttil al 100%, te evitar tener que hacer un compromiso en lo que concierne a la pantalla y al teclado.  <br /> <br /> La increble sutileza de MacBook Air es el resultado de un gran nmero de innovaciones en materia de reduccin de tamao y peso. Desde un disco duro ms fino hasta puertos E/S disimulados hbilmente pasando por una batera ms plana, cada detalle se consider para que el resultado fuera lo ms fino posible.<br /> <br /> MacBook Air fue creado y elaborado para disfrutar plenamente del mundo inalmbrico. Un mundo en el que la norma Wi-Fi 802.11n es tan rpida y accesible que permite liberarse completamente de cualquier atadura para comprar videos en lnea, descargar programas, almacenar y compartir archivos en la Red.</p>', '<p>MacBook Air es ultra fino, ultra porttil y ultra diferente de todo el resto. Pero no se pierden kilos y centmetros en tan solo una noche. Todo esto es el resultado de un nuevo invento de normas. De un sinfn de novedades sin cable. Y de una revolucin en el diseo. Con MacBook Air, la informtica mvil adquiere una nueva dimensin.</p>', 'macbook-air', '', '', '', 'MacBook Air', 'Disponible', '');
INSERT INTO `ps_product_lang` VALUES ('5', '4', '<p>MacBook Air ist kaum dicker als Ihr Zeigefinger. Nahezu jedes Detail wurde abgeflacht. Und dabei hat es immer noch einen 13,3-Zoll-Widescreen-LED-Display, eine Tastatur in voller Gre und einen groen Multi-Touch-Trackpad. Es besitzt eine unvergleichliche Tragbarkeit, ohne die blichen Kompromisse fr ultraportable Bildschirme und Tastaturen.</P>Der unglaublich dnne MacBook Air ist das Ergebnis zahlreicher Innovationen zur Gren- und Gewichtsoptimierung. Die flachere Festplatte, die strategisch versteckten I/O-Ports und eine noch flachere Batterie: Alles wurde immer wieder berdacht, immer mit dem Ziel, es noch dnner zu gestalten.</P>Das Design und Konzept von MacBook Air ist voll auf die Vorteile der Kabelfreiheit ausgerichtet. Eine Welt, in der 802.11n WLAN heutzutage so schnell und so leicht verfgbar ist, dass die Menschen heute grenzenlos Filme online kaufen oder mieten, Software downloaden und Dateien ber das Internet teilen oder speichern knnen. </P>', 'MacBook Air is ultrathin, ultraportable, and ultra unlike anything else. But you dont lose inches and pounds overnight. Its the result of rethinking conventions. Of multiple wireless innovations. And of breakthrough design. With MacBook Air, mobile computing suddenly has a new standard.', 'macbook-Air', '', '', '', 'MacBook Air', '', null);
INSERT INTO `ps_product_lang` VALUES ('5', '5', '<p>MacBook Air  sottile quasi come il tuo indice. Praticamente ogni dettaglio  stato semplificato al massimo. Eppure riesce ad avere uno schermo LED di 13,3 pollici, tastiera completa, e un ampio track-pad multi-touch. Incredibilmente portatile, non soffre dei compromessi tra schermo e tastiera.</p><p>La sottigliezza incredibile di MacBook Air  il risultato di moltissime innovazioni nel campo della riduzione di dimensioni e peso. Un hard drive pi sottile, porte I/O strategicamente nascoste, batteria pi piatta: tutto  stato ben calibrato pensando sempre alla sottigliezza.</p><p>MacBook Air  stato progettato e realizzato per godere a pieno dell\'universo del wireless. In un mondo in cui la norma 802.11n Wi-Fi  ormai rapida e disponibile, le persone vivono connesse -  acquistano e noleggiano film online,  scaricano programmi, condividono e conservano file nel web. </p>', 'MacBook Air  ultra-piatto, ultra-portatile, e ultra come nient\'altro al mondo.  Ma non si perdono chili e centimetri in una notte. E\' il risultato di una rielaborazione degli standard. Di moltissime innovazioni sul wireless. E di un design rivoluzionario. Con MacBook Air, l\'informatica mobile acquista una nuova dimensione.', 'macbook-air', '', '', '', 'MacBook Air', '', null);
INSERT INTO `ps_product_lang` VALUES ('5', '6', '<p>MacBook Air is nearly as thin as your index finger. Practically every detail that could be streamlined has been. Yet it still has a 13.3-inch widescreen LED display, full-size keyboard, and large multi-touch trackpad. Its incomparably portable without the usual ultraportable screen and keyboard compromises.</p><p>The incredible thinness of MacBook Air is the result of numerous size- and weight-shaving innovations. From a slimmer hard drive to strategically hidden I/O ports to a lower-profile battery, everything has been considered and reconsidered with thinness in mind.</p><p>MacBook Air is designed and engineered to take full advantage of the wireless world. A world in which 802.11n Wi-Fi is now so fast and so available, people are truly living untethered  buying and renting movies online, downloading software, and sharing and storing files on the web. </p>', 'MacBook Air is ultrathin, ultraportable, and ultra unlike anything else. But you dont lose inches and pounds overnight. Its the result of rethinking conventions. Of multiple wireless innovations. And of breakthrough design. With MacBook Air, mobile computing suddenly has a new standard.', 'macbook-air', '', '', '', 'MacBook Air', '', null);
INSERT INTO `ps_product_lang` VALUES ('6', '1', 'Every MacBook has a larger hard drive, up to 250GB, to store growing media collections and valuable data.<br /><br />The 2.4GHz MacBook models now include 2GB of memory standard  perfect for running more of your favorite applications smoothly.', 'MacBook makes it easy to hit the road thanks to its tough polycarbonate case, built-in wireless technologies, and innovative MagSafe Power Adapter that releases automatically if someone accidentally trips on the cord.', 'macbook', '', '', '', 'MacBook', '', null);
INSERT INTO `ps_product_lang` VALUES ('6', '2', 'Chaque MacBook est quip d\'un disque dur plus spacieux, d\'une capacit atteignant 250 Go, pour stocker vos collections multimdia en expansion et vos donnes prcieuses.<br /><br />Le modle MacBook  2,4 GHz intgre dsormais 2 Go de mmoire en standard. L\'idal pour excuter en souplesse vos applications prfres.', 'MacBook vous offre la libert de mouvement grce  son botier rsistant en polycarbonate,  ses technologies sans fil intgres et  son adaptateur secteur MagSafe novateur qui se dconnecte automatiquement si quelqu\'un se prend les pieds dans le fil.', 'macbook', '', '', '', 'MacBook', '', null);
INSERT INTO `ps_product_lang` VALUES ('6', '3', '<p>Cada MacBook est equipado de un disco duro ms espacioso, de una capacidad de hasta  250 Go, para almacenar tus colecciones multimedia en expansin y tus datos ms preciados. <br /> El modelo  MacBook de 2,4 GHz integra 2 Go de memoria en estndar. Lo ideal para realizar sin dificultad tus aplicaciones preferidas.</p>', '<p>MacBook te ofrece una gran libertad de movimientos gracias a su exterior resistente en policarbonato, a su tecnologa sin cable y a su adaptador cargador sector innovador que se desconecta automticamente si alguien se engancha en el cable.</p>', 'macbook', '', '', '', 'MacBook', 'Disponible', '');
INSERT INTO `ps_product_lang` VALUES ('6', '4', 'Jedes MacBook verfgt ber eine grere Festplatte, bis zu 250GB, zum Speichern immer grer werdender Mediensammlungen und wertvoller Daten.<br/><br/>Die 2,4 GHz MacBook-Modelle haben nun 2 GB Standard-Arbeitsspeicher - ideal zum reibungslosen Abspielen Ihrer Lieblings-Anwendungen.', 'MacBook makes it easy to hit the road thanks to its tough polycarbonate case, built-in wireless technologies, and innovative MagSafe Power Adapter that releases automatically if someone accidentally trips on the cord.', 'macbook', '', '', '', 'MacBook', '', null);
INSERT INTO `ps_product_lang` VALUES ('6', '5', 'Tutti i MacBook hanno un hard drive pi ampio, fino a 250GB, per conservare le tue raccolte multimediali e i dati importanti.<br /><br />I modelli MacBook a 2,4GHz  ora includono 2GB di memoria standard  ideale per le tue applicazioni preferite.', 'MacBook ti offre il massimo della libert di movimento grazie alla sua struttura resistente in policarbonato, alle tecnologie integrate wireless, e all\'innovativo MagSafe Power Adapter che si stacca automaticamente se qualcuno accidentalmente inciampa nel cavo.', 'macbook', '', '', '', 'MacBook', '', null);
INSERT INTO `ps_product_lang` VALUES ('6', '6', 'Every MacBook has a larger hard drive, up to 250GB, to store growing media collections and valuable data.<br /><br />The 2.4GHz MacBook models now include 2GB of memory standard  perfect for running more of your favorite applications smoothly.', 'MacBook makes it easy to hit the road thanks to its tough polycarbonate case, built-in wireless technologies, and innovative MagSafe Power Adapter that releases automatically if someone accidentally trips on the cord.', 'macbook', '', '', '', 'MacBook', '', null);
INSERT INTO `ps_product_lang` VALUES ('7', '1', '<h3>Five new hands-on applications</h3>\r\n<p>View rich HTML email with photos as well as PDF, Word, and Excel attachments. Get maps, directions, and real-time traffic information. Take notes and read stock and weather reports.</p>\r\n<h3>Touch your music, movies, and more</h3>\r\n<p>The revolutionary Multi-Touch technology built into the gorgeous 3.5-inch display lets you pinch, zoom, scroll, and flick with your fingers.</p>\r\n<h3>Internet in your pocket</h3>\r\n<p>With the Safari web browser, see websites the way they were designed to be seen and zoom in and out with a tap.<sup>2</sup> And add Web Clips to your Home screen for quick access to favorite sites.</p>\r\n<h3>What\'s in the box</h3>\r\n<ul>\r\n<li><span></span>iPod touch</li>\r\n<li><span></span>Earphones</li>\r\n<li><span></span>USB 2.0 cable</li>\r\n<li><span></span>Dock adapter</li>\r\n<li><span></span>Polishing cloth</li>\r\n<li><span></span>Stand</li>\r\n<li><span></span>Quick Start guide</li>\r\n</ul>', '<ul>\r\n<li>Revolutionary Multi-Touch interface</li>\r\n<li>3.5-inch widescreen color display</li>\r\n<li>Wi-Fi (802.11b/g)</li>\r\n<li>8 mm thin</li>\r\n<li>Safari, YouTube, Mail, Stocks, Weather, Notes, iTunes Wi-Fi Music Store, Maps</li>\r\n</ul>', 'ipod-touch', '', '', '', 'iPod touch', '', null);
INSERT INTO `ps_product_lang` VALUES ('7', '2', '<h1>Titre 1</h1>\r\n<h2>Titre 2</h2>\r\n<h3>Titre 3</h3>\r\n<h4>Titre 4</h4>\r\n<h5>Titre 5</h5>\r\n<h6>Titre 6</h6>\r\n<ul>\r\n<li>UL</li>\r\n<li>UL</li>\r\n<li>UL</li>\r\n<li>UL</li>\r\n</ul>\r\n<ol>\r\n<li>OL</li>\r\n<li>OL</li>\r\n<li>OL</li>\r\n<li>OL</li>\r\n</ol>\r\n<p>paragraphe...</p>\r\n<p>paragraphe...</p>\r\n<p>paragraphe...</p>\r\n<table border=\"0\">\r\n<thead> \r\n<tr>\r\n<th>th</th> <th>th</th> <th>th</th>\r\n</tr>\r\n</thead> \r\n<tbody>\r\n<tr>\r\n<td>td</td>\r\n<td>td</td>\r\n<td>td</td>\r\n</tr>\r\n<tr>\r\n<td>td</td>\r\n<td>td</td>\r\n<td>td</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3>Cinq nouvelles applications sous la main</h3>\r\n<p>Consultez vos e-mails au format HTML enrichi, avec photos et pieces jointes au format PDF, Word et Excel. Obtenez des cartes, des itinraires et des informations sur l\'tat de la circulation en temps rel. Rdigez des notes et consultez les cours de la Bourse et les bulletins mto.</p>\r\n<h3>Touchez du doigt votre musique et vos vidos. Entre autres.</h3>\r\n<p>La technologie multi-touch rvolutionnaire intgre au superbe cran de 3,5 pouces vous permet d\'effectuer des zooms avant et arrire, de faire dfiler et de feuilleter des pages  l\'aide de vos seuls doigts.</p>\r\n<h3>Internet dans votre poche</h3>\r\n<p>Avec le navigateur Safari, vous pouvez consulter des sites web dans leur mise en page d\'origine et effectuer un zoom avant et arrire d\'une simple pression sur l\'cran.</p>\r\n<h3>Contenu du coffret</h3>\r\n<ul>\r\n<li><span></span>iPod touch</li>\r\n<li><span></span>couteurs</li>\r\n<li><span></span>Cble USB 2.0</li>\r\n<li><span></span>Adaptateur Dock</li>\r\n<li><span></span>Chiffon de nettoyage</li>\r\n<li><span></span>Support</li>\r\n<li><span></span>Guide de dmarrage rapide</li>\r\n</ul>\r\n<p></p>', '<p>Interface multi-touch rvolutionnaire<br />cran panoramique couleur de 3,5 pouces<br />Wi-Fi (802.11b/g)<br />8 mm d\'paisseur<br />Safari, YouTube, iTunes Wi-Fi Music Store, Courrier, Cartes, Bourse, Mto, Notes</p>', 'ipod-touch', '', '', '', 'iPod touch', 'En stock', null);
INSERT INTO `ps_product_lang` VALUES ('7', '3', '<p>Cinco nuevas aplicaciones a mano</p>\r\n<p><br /> Consulta tu correo en formato HTML enriquecido, con fotos y ficheros adjuntos en formato PDF, Word y Excel. Consigue mapas, itinerarios e informacin sobre el estado de la carreteras en tiempo real. Escribe notas y consulta la bolsa y el tiempo. <br /> Alcanza con un dedo tu msica y tus videos, entre otras cosas. <br /> La tecnologa multi-touch revolucionaria integrada a la magnfica pantalla de 3,5 pulgadas te permitir efectuar zoom hacia adelante y hacia atrs, y pasar y ojear las pginas solo con la ayuda de tus dedos.</p>\r\n<p>Internet en tu bolsillo</p>\r\n<p>Con el navegador Safari, podrs consultar sitios web en su compaginacin de origen y efectuar un zoom hacia adelante y hacia atrs con la simple presin de un dedo en la pantalla.</p>\r\n<p>Contenido del estuche<br />    * iPod touch<br />    * Auriculares<br />    * Cable USB 2.0<br />    * Adaptador Dock<br />    * Pao de limpieza<br />    * Base<br />    * Gua de inicio rpido<br /> Ttulo<br /> Prrafo</p>', '<p>Interfaz multi-touch revolucionaria<br /> Pantalla panormica color de 3,5 pulgadas<br /> Wi-Fi (802.11b/g)<br /> 8 mm de espesor<br /> Safari, YouTube, iTunes Wi-Fi Music Store, Correo, Mapas, Bolsa, El tiempo, Notas</p>', 'ipod-touch', '', '', '', 'iPod touch', 'Disponible', '');
INSERT INTO `ps_product_lang` VALUES ('7', '4', '<h3>Fnf neue Hands-on-Anwendungen</h3>\r\n<p>Rich-HTML-E-Mails mit Fotos anzeigen sowie PDF-, Word-und Excel-Anhnge. Holen Sie sich Karten, Wegbeschreibungen und Echtzeit-Verkehrsinformationen. Sie knnen sich Notizen machen und Brsen- und Wetterberichte lesen.</P>\r\n<h3>Berhren Sie Ihre Musik, Filme und vieles mehr</h3>\r\n<p>Mit der revolutionren, in den wunderschnen 3,5-Zoll-Display integrierten Multi-Touch-Technologie knnen Sie  zuziehen, zoomen, scrollen und streichen.</p>\r\n<h3>Internet in Ihrer Tasche</h3>\r\n<p>Mit dem Safari-Webbrowser sehen Sie Webseiten so, wie sie gesehen werden sollten und vergrern und verkleinern sie mit einer Berhrung.<sup>2</sup>Fgen Sie Web-Clips zu Ihrer Startseite hinzu fr den Schnellzugriff auf Ihre bevorzugten Webseiten.</p>\r\n<h3>Zum Set gehren/h3>\r\n<ul>\r\n<li><span></span>der iPod touch</li>\r\n<li><span></span>Ohrhrer</li>\r\n<li><span></span>USB 2.0-Kabel</li>\r\n<li><span></span>Anschluss-Adapter</li>\r\n<li><span></span>Poliertuch</li>\r\n<li><span></span>Basis</li>\r\n<li><span></span>Quick Start Guide</li>\r\n</ul>', '<ul>\r\n<li>Revolutionary Multi-Touch interface</li>\r\n<li>3.5-inch widescreen color display</li>\r\n<li>Wi-Fi (802.11b/g)</li>\r\n<li>8 mm thin</li>\r\n<li>Safari, YouTube, Mail, Stocks, Weather, Notes, iTunes Wi-Fi Music Store, Maps</li>\r\n</ul>', 'iPod-Touch', '', '', '', 'iPod touch', '', null);
INSERT INTO `ps_product_lang` VALUES ('7', '5', '<h3>Cinque nuove applicazioni sotto mano</h3>\r\n<p>Consulta le tue e-mail in formato rich HTML con foto e allegati PDF, Word, e Excel. Ottieni mappe, indicazioni stradali e sul traffico in tempo reale.  Prendi appunti e consulta la Borsa e le previsioni meteo.</p>\r\n<h3>Tocca la musica, i film e altro ancora</h3>\r\n<p>La rivoluzionaria tecnologia Multi-Touch integrata al bellissimo schermo da 3,5 pollici ti permette di zoomare avanti e indietro, sfogliare e far scorrere le pagine con le dita.</p>\r\n<h3>Internet in tasca</h3>\r\n<p>Con il web browser Safari, consulta i siti web nella loro impaginazione originale e usa lo zoom avanti e indietro con la sola pressione delle dita.<sup>2</sup> Aggiungi Web Clips al tuo schermo per accedere subito ai siti preferiti.</p>\r\n<h3>Nella confezione</h3>\r\n<ul>\r\n<li><span></span>iPod touch</li>\r\n<li><span></span>Auricolari</li>\r\n<li><span></span>Cavo USB 2.0</li>\r\n<li><span></span>Adattatore Dock</li>\r\n<li><span></span>Panno per la pulizia</li>\r\n<li><span></span>Supporto</li>\r\n<li><span></span>Guida installazione rapida</li>\r\n</ul>', '<ul>\r\n<li>Interfaccia Multi-Touch rivoluzionaria</li>\r\n<li>Schermo widescreen a colori da 3,5 pollici</li>\r\n<li>Wi-Fi (802.11b/g)</li>\r\n<li>8 mm di spessore</li>\r\n<li>Safari, YouTube, Mail, Borsa, Meteo, Appunti, iTunes Wi-Fi Music Store, Mappe</li>\r\n</ul>', 'ipod-touch', '', '', '', 'iPod touch', '', null);
INSERT INTO `ps_product_lang` VALUES ('7', '6', '<h3>Five new hands-on applications</h3>\r\n<p>View rich HTML email with photos as well as PDF, Word, and Excel attachments. Get maps, directions, and real-time traffic information. Take notes and read stock and weather reports.</p>\r\n<h3>Touch your music, movies, and more</h3>\r\n<p>The revolutionary Multi-Touch technology built into the gorgeous 3.5-inch display lets you pinch, zoom, scroll, and flick with your fingers.</p>\r\n<h3>Internet in your pocket</h3>\r\n<p>With the Safari web browser, see websites the way they were designed to be seen and zoom in and out with a tap.<sup>2</sup> And add Web Clips to your Home screen for quick access to favorite sites.</p>\r\n<h3>What\'s in the box</h3>\r\n<ul>\r\n<li><span></span>iPod touch</li>\r\n<li><span></span>Earphones</li>\r\n<li><span></span>USB 2.0 cable</li>\r\n<li><span></span>Dock adapter</li>\r\n<li><span></span>Polishing cloth</li>\r\n<li><span></span>Stand</li>\r\n<li><span></span>Quick Start guide</li>\r\n</ul>', '<ul>\r\n<li>Revolutionary Multi-Touch interface</li>\r\n<li>3.5-inch widescreen color display</li>\r\n<li>Wi-Fi (802.11b/g)</li>\r\n<li>8 mm thin</li>\r\n<li>Safari, YouTube, Mail, Stocks, Weather, Notes, iTunes Wi-Fi Music Store, Maps</li>\r\n</ul>', 'ipod-touch', '', '', '', 'iPod touch', '', null);
