INSERT INTO `ps_product_lang` VALUES ('8', '2', '<p><strong>Caractristiques</strong></p>\r\n<li>Cuir doux rsistant<br /> </li>\r\n<li>Accs au bouton Hold<br /> </li>\r\n<li>Fermeture magntique<br /> </li>\r\n<li>Accs au Dock Connector<br /> </li>\r\n<li>Protge-cran</li>', '<p>Cet tui en cuir tendance assure une protection complte contre les raflures et les petits alas de la vie quotidienne. Sa conception lgante et compacte vous permet de glisser votre iPod directement dans votre poche ou votre sac  main.</p>', 'housse-portefeuille-en-cuir-ipod-nano-noir-chocolat', '', '', '', 'Housse portefeuille en cuir (iPod nano) - Noir/Chocolat', '', null);
INSERT INTO `ps_product_lang` VALUES ('8', '3', '<p><strong>Caractersticas</strong></p>\r\n<ul>\r\n<li> Cuero suave resistente</li>\r\n<li>Acceso a la tecla Hold</li>\r\n<li>Cierre magntico</li>\r\n<li>Acceso al Dock Conector</li>\r\n<li>Salva pantallas</li>\r\n</ul>', '<p>Este estuche de cuero de ltima moda garantiza una completa proteccin contra los araazos y los pequeos contratiempos de la vida diaria. Su diseo elegante y compacto te permite meter tu Ipod directamente en tu bolsillo o en tu bolso.</p>', 'funda-cuero-ipod-nano-negro-chocolate', '', '', '', 'Leather Case (iPod nano) - Negro / Chocolate', 'Disponible', '');
