INSERT INTO `ps_product_lang` VALUES ('9', '1', '<div class=\"product-overview-full\">Using Hi-Definition MicroSpeakers to deliver full-range audio, the ergonomic and lightweight design of the SE210 earphones is ideal for premium on-the-go listening on your iPod or iPhone. They offer the most accurate audio reproduction from both portable and home stereo audio sources--for the ultimate in precision highs and rich low end. In addition, the flexible design allows you to choose the most comfortable fit from a variety of wearing positions. <br /> <br /> <strong>Features </strong> <br /> \r\n<ul>\r\n<li>Sound-isolating design </li>\r\n<li> Hi-Definition MicroSpeaker with a single balanced armature driver </li>\r\n<li> Detachable, modular cable so you can make the cable longer or shorter depending on your activity </li>\r\n<li> Connector compatible with earphone ports on both iPod and iPhone </li>\r\n</ul>\r\n<strong>Specifications </strong><br /> \r\n<ul>\r\n<li>Speaker type: Hi-Definition MicroSpeaker </li>\r\n<li> Frequency range: 25Hz-18.5kHz </li>\r\n<li> Impedance (1kHz): 26 Ohms </li>\r\n<li> Sensitivity (1mW): 114 dB SPL/mW </li>\r\n<li> Cable length (with extension): 18.0 in./45.0 cm (54.0 in./137.1 cm) </li>\r\n</ul>\r\n<strong>In the box</strong><br /> \r\n<ul>\r\n<li>Shure SE210 earphones </li>\r\n<li> Extension cable (36.0 in./91.4 cm) </li>\r\n<li> Three pairs foam earpiece sleeves (small, medium, large) </li>\r\n<li> Three pairs soft flex earpiece sleeves (small, medium, large) </li>\r\n<li> One pair triple-flange earpiece sleeves </li>\r\n<li> Carrying case </li>\r\n</ul>\r\nWarranty<br /> Two-year limited <br />(For details, please visit <br />www.shure.com/PersonalAudio/CustomerSupport/ProductReturnsAndWarranty/index.htm.) <br /><br /> Mfr. Part No.: SE210-A-EFS <br /><br />Note: Products sold through this website that do not bear the Apple Brand name are serviced and supported exclusively by their manufacturers in accordance with terms and conditions packaged with the products. Apple\'s Limited Warranty does not apply to products that are not Apple-branded, even if packaged or sold with Apple products. Please contact the manufacturer directly for technical support and customer service.</div>', '<p>Evolved from personal monitor technology road-tested by pro musicians and perfected by Shure engineers, the lightweight and stylish SE210 delivers full-range audio that\'s free from outside noise.</p>', 'ecouteurs-a-isolation-sonore-shure-se210-blanc', '', '', '', 'Shure SE210 Sound-Isolating Earphones for iPod and iPhone', '', null);
INSERT INTO `ps_product_lang` VALUES ('9', '2', '<p>Bass sur la technologie des moniteurs personnels teste sur la route par des musiciens professionnels et perfectionne par les ingnieurs Shure, les couteurs SE210, lgers et lgants, fournissent une sortie audio  gamme tendue exempte de tout bruit externe.</p><br /><p><strong>Conception  isolation sonore <br /></strong>Les embouts  isolation sonore fournis bloquent plus de 90 % du bruit ambiant. Combins  un design ergonomique sduisant et un cble modulaire, ils minimisent les intrusions du monde extrieur, vous permettant de vous concentrer sur votre musique. Conus pour les amoureux de la musique qui souhaitent faire voluer leur appareil audio portable, les couteurs SE210 vous permettent d\'emmener la performance avec vous. <br /> <br /><strong>Micro-transducteur haute dfinition <br /></strong>Dvelopps pour une coute de qualit suprieure en dplacement, les couteurs SE210 utilisent un seul transducteur  armature quilibre pour bnficier d\'une gamme audio tendue. Le rsultat ? Un confort d\'coute poustouflant qui restitue tous les dtails d\'un spectacle live.</p>\r\n<p><strong>Le kit universel Deluxe comprend les lments suivants : <br /></strong>- <strong><em>Embouts  isolation sonore</em></strong> <br />Les embouts  isolation sonore inclus ont un double rle : bloquer les bruits ambiants et garantir un maintien et un confort personnaliss. Comme chaque oreille est diffrente, le kit universel Deluxe comprend trois tailles (S, M, L) d\'embouts mousse et flexibles. Choisissez la taille et le style d\'embout qui vous conviennent le mieux : une bonne tanchit est un facteur cl pour optimiser l\'isolation sonore et la rponse des basses, ainsi que pour accrotre le confort en coute prolonge.<br /><br />- <em><strong>Cble modulaire</strong></em> <br />En se basant sur les commentaires de nombreux utilisateurs, les ingnieurs de Shure ont dvelopp une solution de cble dtachable pour permettre un degr de personnalisation sans prcdent. Le cble de 1 mtre fourni vous permet d\'adapter votre confort en fonction de l\'activit et de l\'application.<br /> <br />- <em><strong>tui de transport</strong></em> <br />Outre les embouts  isolation sonore et le cble modulaire, un tui de transport compact et rsistant est fourni avec les couteurs SE210 pour vous permettre de ranger vos couteurs de manire pratique et sans encombres.<br /> <br />- <strong><em>Garantie limite de deux ans <br /></em></strong>Chaque solution SE210 achete est couverte par une garantie pices et main-d\'uvre de deux ans.<br /><br /><strong>Caractristiques techniques</strong></p>\r\n<ul>\r\n<li> Type de transducteur : micro-transducteur haute dfinition<br /></li>\r\n<li> Sensibilit (1 mW) : pression acoustique de 114 dB/mW<br /></li>\r\n<li> Impdance ( 1 kHz) : 26 W<br /></li>\r\n<li> Gamme de frquences : 25 Hz  18,5 kHz<br /></li>\r\n<li> Longueur de cble / avec rallonge : 45 cm / 136 cm<br /></li>\r\n</ul>\r\n<p><strong>Contenu du coffret<br /></strong></p>\r\n<ul>\r\n<li> couteurs Shure SE210<br /></li>\r\n<li> Kit universel Deluxe (embouts  isolation sonore, cble modulaire, tui de transport)</li>\r\n</ul>', '<p>Les couteurs  isolation sonore ergonomiques et lgers offrent la reproduction audio la plus fidle en provenance de sources audio stro portables ou de salon.</p>', 'ecouteurs-a-isolation-sonore-shure-se210', '', '', '', 'couteurs  isolation sonore Shure SE210', '', null);
INSERT INTO `ps_product_lang` VALUES ('9', '3', '<p>Los auriculares SE210, ligeros y elegantes, estn basados en la tecnologa de los monitores personales que los msicos profesionales utilizan en carretera y que los ingenieros de Shure han perfeccionado. Tambin estn provistos de una salida audio de gama extendida exenta de todo ruido exterior. <br /> <br /> <strong>Creado para un aislamiento sonoro</strong></p>\r\n<p>Las almohadillas provistas de un aislamiento sonoro bloquean ms del 90% del ruido ambiente. Combinadas con un diseo ergonmico atractivo y un cable modular, minimizan las intrusiones del mundo exterior y te permiten concentrarte en tu msica. Creados para los apasionados por la msica que quieren que su aparato audio mvil evolucione, los auriculares  SE210 te permitirn llevar la tecnologa all donde t vayas. <br /> <br /> <strong>Micro-transductor alta definicin </strong><br /> Desarrollados para poder tener una audicin de calidad durante los desplazamientos, los auriculares SE210 utilizan un nico transductor con un armazn equilibrado para poder disfrutar de una gama audio extendida. El resultado ? Un confort audio increble que restituye cada detalle de un espectculo en directo. <br /> <br /> <strong>El kit universal Deluxe incluye los siguientes elementos :</strong><br /> - Almohadillas para aislamiento sonoro<br /> Las almohadillas para el aislamiento sonoro tienen una doble funcin : bloquear el ruido ambiente y garantizar una estabilidad y un confort personalizados. Como cada oreja es diferente el kit universal Deluxe incluye tres tallas (S, M, L) de almohadillas de espuma y flexibles. Elige la talla y el estilo de almohadilla que mejor te convenga : un buen aislamiento es un factor clave tanto para optimizar el aislamiento sonoro y la respuesta de los bajos como para aumentar el confort durante una audicin prolongada. <br /> <br /> - Cable modular</p>\r\n<p>Basndose en los comentarios de los numerosos usuarios, los ingenieros de Shure han creado una solucin de cable separable para permitir un grado de personalizacin sin precedentes. El cable de 1 metro te permite adaptar el confort en funcin de la actividad del momento y de la aplicacin. <br /> <br /> - Estuche para el transporte</p>\r\n<p>Adems de las almohadillas de aislamiento sonoro y del cable modular, los auriculares SE210 estn provistos de un estuche de transporte compacto y resistente para guardar los auriculares de manera prctica y sin dificultad. <br /> - Garanta lmite de dos aos <br /> Cada solucin SE210 tiene una garanta piezas y mano de obra de dos aos.</p>\r\n<p><br /> <em><strong>Caractersticas tcnicas</strong></em></p>\r\n<ul>\r\n<li>Tipo de transductor : micro-transductor alta definicin</li>\r\n<li>Sensibilidad (1 mW) : presin acstica de 114 dB/mW</li>\r\n<li>Impedancia : ( 1 kHz) : 26 W</li>\r\n<li>Gama de frecuencias : 25 Hz  18,5 kHz</li>\r\n<li>Longitud del cable / con alargador : 45 cm / 136 cm</li>\r\n</ul>\r\n<p><br /> <strong><em>Contenido de la caja</em></strong></p>\r\n<ul>\r\n<li>Altavoces Shure SE210</li>\r\n<li>Kit universal Deluxe (almohadillas de aislamiento sonoro, cable modular, estuche de transporte)</li>\r\n</ul>', '<p>Los auriculares con aislamiento ergonmicos y ligeros ofrecen la reproduccin ms fiel proveniente de fuentes audio estreo mviles o de saln.</p>', 'auriculares-aislantes-del-sonido-shure-se210', '', '', '', 'Auriculares aislantes del sonido Shure SE210', 'Disponible', '');
INSERT INTO `ps_product_lang` VALUES ('9', '4', '<div class=\"product-overview-full\">Mit ihren hochauflsenden Micro-Lautsprechern, die vollen Klang liefern und ihrem ergonomischen, leichten Design sind die SE210 Ohrhrer ideal zum mobilen Extraklasse-Musik hren auf Ihrem iPod oder iPhone. Sie bieten die genaueste Tonwiedergabe, sowohl aus tragbaren als auch aus Home-Stereo-Audio-Quellen - fr ultimative przisen Hhen und kraftvolle Bsse. Darber hinaus ermglicht das flexible Design optimalen Tragekomfort durch eine Vielzahl von Tragemglichkeiten. <br/><br/>Funktionen</strong><br/>\r\n<ul>\r\n<li>Klangisolierendes Design</li>\r\n<li>Hochauflsende Micro-Lautsprecher mit Single Balanced Armature-Treiber</li>\r\n<li>Abnehmbare modulare Kabel, die Sie je nach Aktivitt lnger oder krzer einstellen knnen</li>\r\n<li>Kompatibler Stecker mit Kopfhrer-Anschlssen fr iPod und iPhone</li>\r\n</ul>\r\n<strong>Daten</strong><br/>\r\n<ul>\r\n<li>Lautsprecher-Typ: Hochauflsende Micro-Lautsprecher</li>\r\n<li> Frequenzbereich: 25Hz-18.5kHz </li>\r\n<li>Impedanz (1kHz): 26 Ohm </li>\r\n<li>Empfindlichkeit (1mW): 114 dB SPL/mW</li>\r\n<li> Kabellnge (mit Erweiterung): 18,0 Zoll/45,0 cm (54,0 Zoll/137,1 cm) </li>\r\n</ul>\r\n<strong>Im Set enthalten</strong><br/>\r\n<ul>\r\n<li>Shure SE210 Ohrhrer </li>\r\n<li> Verlngerungskabel (36,0 Zoll/91,4 cm) </li>\r\n<li> Drei Paar Schaumstoff-Hrmuschelhllen (klein, mittel, gro) </li>\r\n<li> Drei Paar weiche Flex-Hrmuschelhllen (klein, mittel, gro) </li>\r\n<li> Ein Paar Triple-Flange-Hrmuschelhllen </li>\r\n<li> Trage-Etui </li>\r\n</ul>\r\nGarantie<br /> Zwei Jahre <br />(Einzelheiten hierzu finden Sie auf <br />www.shure.com/PersonalAudio/CustomerSupport/ProductReturnsAndWarranty/index.htm). <br /><br /> Mfr. Teilenummer: SE210-A-EFS <br /><br />Hinweis: Fr Produkte auf dieser Website, die nicht den Markennamen Apple tragen, werden Service und Support ausschlielich von den Herstellern gem der den Produkten beiliegenden Nutzungsbedingungen bernommen. Die von Apple angebotene Garantiezeit gilt nicht fr Produkte, die kein Apple-Markenzeichen tragen, selbst wenn diese zusammen mit Apple-Produkten verpackt oder verkauft wurden. Bitte wenden Sie sich direkt an den Hersteller fr den technischen Support und Kundendienst.</div>', '<p>Evolved from personal monitor technology road-tested by pro musicians and perfected by Shure engineers, the lightweight and stylish SE210 delivers full-range audio that\'s free from outside noise.</p>', 'klangisolierte-ohrhorer-shure-se210-weib', '', '', '', 'Shure SE210 Klangisolierte Ohrhrer fr iPod und iPhone', '', null);
INSERT INTO `ps_product_lang` VALUES ('9', '5', '<div class=\"product-overview-full\">L\'ascolto con la tecnologia dei Micro-Auricolari ad Alta Definizione permette l\'ascolto ideale del tuo iPod o iPhone. E\' quanto ti offre il design leggero, ergonomico ed elegante degli auricolari SE210. Ti garantiscono un rendimento audio ad alto livello di stereo portatili e fissi, per un livello di precisione mai raggiunto prima.  Inoltre, la forma flessibile ti peremtte di scegliere la posizione migliore per indossarli. <br /> <br /> <strong>Caratteristiche</strong> <br /> \r\n<ul>\r\n<li>Design di isolamento del suono </li>\r\n<li> Micro-speaker ad alta definizione con driver singolo ad armatura bilanciata </li>\r\n<li> Cavo staccabile e regolabile in modo da poterlo allungare o accorciare in base alle tue attivit </li>\r\n<li> Connettore compatibile con porte auricolari sia su iPod che iPhone </li>\r\n</ul>\r\n<strong>Specifiche tecniche </strong><br /> \r\n<ul>\r\n<li>Tipo speaker: MicroSpeaker ad alta definizione</li>\r\n<li> Gamma di frequenza: 25Hz-18.5kHz </li>\r\n<li> Impedenza (1kHz): 26 Ohms </li>\r\n<li> Sensibilit (1mW): 114 dB SPL/mW </li>\r\n<li> Lunghezza cavo (con prolunga): 18.0 in./45,0 cm (54.0 in./137,1 cm) </li>\r\n</ul>\r\n<strong>Nella confezione</strong><br /> \r\n<ul>\r\n<li>Auricolari Shure SE210 </li>\r\n<li> Cavo prolunga (36.0 in./91,4 cm) </li>\r\n<li> Tre paia di imbuti in spugna (small, medium, large) </li>\r\n<li> Tre paia di imbuti morbidi (small, medium, large) </li>\r\n<li> Un paio di imbuti a tripla aletta </li>\r\n<li> Custodia da viaggio </li>\r\n</ul>\r\nGaranzia<br /> Due anni limitata <br />(Per informazioni, visitare <br />www.shure.com/PersonalAudio/CustomerSupport/ProductReturnsAndWarranty/index.htm.) <br /><br /> Mfr. Parte N.: SE210-A-EFS <br /><br />Nota: I prodotti venduti tramite questo sito web e che non hanno il marchio Apple ricevono assistenza esclusivamente dai loro produttori con i termini e le condizioni contenute nella confezione del prodotto.  La Garanzia Limitata di Apple non si applica ai prodotti che non appartengono al marchio Apple, anche se imballati o venduti con i prodotti Apple . Contatta direttamente il produttore per supporto tecnico e servizio clienti.</div>', '<p>Basati sulla tecnologia all\'avanguardia, testati da musicisti professionisti, e messi a punto da ingegneri Shure, i leggeri ed eleganti SE210 offrono un suono nitido e privo di rumori di fondo.</p>', 'ecouteurs-a-isolation-sonore-shure-se210-blanc', '', '', '', 'auricolari-sound-isolating-shure-se210-per-ipod-e-iphone', '', null);
INSERT INTO `ps_product_lang` VALUES ('9', '6', '<div class=\"product-overview-full\">Using Hi-Definition MicroSpeakers to deliver full-range audio, the ergonomic and lightweight design of the SE210 earphones is ideal for premium on-the-go listening on your iPod or iPhone. They offer the most accurate audio reproduction from both portable and home stereo audio sources--for the ultimate in precision highs and rich low end. In addition, the flexible design allows you to choose the most comfortable fit from a variety of wearing positions. <br /> <br /> <strong>Features </strong> <br /> \r\n<ul>\r\n<li>Sound-isolating design </li>\r\n<li> Hi-Definition MicroSpeaker with a single balanced armature driver </li>\r\n<li> Detachable, modular cable so you can make the cable longer or shorter depending on your activity </li>\r\n<li> Connector compatible with earphone ports on both iPod and iPhone </li>\r\n</ul>\r\n<strong>Specifications </strong><br /> \r\n<ul>\r\n<li>Speaker type: Hi-Definition MicroSpeaker </li>\r\n<li> Frequency range: 25Hz-18.5kHz </li>\r\n<li> Impedance (1kHz): 26 Ohms </li>\r\n<li> Sensitivity (1mW): 114 dB SPL/mW </li>\r\n<li> Cable length (with extension): 18.0 in./45.0 cm (54.0 in./137.1 cm) </li>\r\n</ul>\r\n<strong>In the box</strong><br /> \r\n<ul>\r\n<li>Shure SE210 earphones </li>\r\n<li> Extension cable (36.0 in./91.4 cm) </li>\r\n<li> Three pairs foam earpiece sleeves (small, medium, large) </li>\r\n<li> Three pairs soft flex earpiece sleeves (small, medium, large) </li>\r\n<li> One pair triple-flange earpiece sleeves </li>\r\n<li> Carrying case </li>\r\n</ul>\r\nWarranty<br /> Two-year limited <br />(For details, please visit <br />www.shure.com/PersonalAudio/CustomerSupport/ProductReturnsAndWarranty/index.htm.) <br /><br /> Mfr. Part No.: SE210-A-EFS <br /><br />Note: Products sold through this website that do not bear the Apple Brand name are serviced and supported exclusively by their manufacturers in accordance with terms and conditions packaged with the products. Apple\'s Limited Warranty does not apply to products that are not Apple-branded, even if packaged or sold with Apple products. Please contact the manufacturer directly for technical support and customer service.</div>', '<p>Evolved from personal monitor technology road-tested by pro musicians and perfected by Shure engineers, the lightweight and stylish SE210 delivers full-range audio that\'s free from outside noise.</p>', 'ecouteurs-a-isolation-sonore-shure-se210-blanc', '', '', '', 'Shure SE210 Sound-Isolating Earphones for iPod and iPhone', '', null);
INSERT INTO `ps_product_lang` VALUES ('10', '1', '<p>MacBook Air is nearly as thin as your index finger. Practically every detail that could be streamlined has been. Yet it still has a 13.3-inch widescreen LED display, full-size keyboard, and large multi-touch trackpad. Its incomparably portable without the usual ultraportable screen and keyboard compromises.</p><p>The incredible thinness of MacBook Air is the result of numerous size- and weight-shaving innovations. From a slimmer hard drive to strategically hidden I/O ports to a lower-profile battery, everything has been considered and reconsidered with thinness in mind.</p><p>MacBook Air is designed and engineered to take full advantage of the wireless world. A world in which 802.11n Wi-Fi is now so fast and so available, people are truly living untethered  buying and renting movies online, downloading software, and sharing and storing files on the web. </p>', 'MacBook Air is ultrathin, ultraportable, and ultra unlike anything else. But you dont lose inches and pounds overnight. Its the result of rethinking conventions. Of multiple wireless innovations. And of breakthrough design. With MacBook Air, mobile computing suddenly has a new standard.', 'macbook-air', '', '', '', 'MacBook Air', '', '');
INSERT INTO `ps_product_lang` VALUES ('10', '2', '<p>MacBook Air est presque aussi fin que votre index. Pratiquement tout ce qui pouvait tre simplifi l\'a t. Il n\'en dispose pas moins d\'un cran panoramique de 13,3 pouces, d\'un clavier complet et d\'un vaste trackpad multi-touch. Incomparablement portable il vous vite les compromis habituels en matire d\'cran et de clavier ultra-portables.</p><p>L\'incroyable finesse de MacBook Air est le rsultat d\'un grand nombre d\'innovations en termes de rduction de la taille et du poids. D\'un disque dur plus fin  des ports d\'E/S habilement dissimuls en passant par une batterie plus plate, chaque dtail a t considr et reconsidr avec la finesse  l\'esprit.</p><p>MacBook Air a t conu et labor pour profiter pleinement du monde sans fil. Un monde dans lequel la norme Wi-Fi 802.11n est dsormais si rapide et si accessible qu\'elle permet vritablement de se librer de toute attache pour acheter des vidos en ligne, tlcharger des logiciels, stocker et partager des fichiers sur le Web. </p>', 'MacBook Air est ultra fin, ultra portable et ultra diffrent de tout le reste. Mais on ne perd pas des kilos et des centimtres en une nuit. C\'est le rsultat d\'une rinvention des normes. D\'une multitude d\'innovations sans fil. Et d\'une rvolution dans le design. Avec MacBook Air, l\'informatique mobile prend soudain une nouvelle dimension.', 'macbook-air', '', '', '', 'MacBook Air', '', '');
INSERT INTO `ps_product_lang` VALUES ('10', '3', '<p>MacBook Air es casi tan fino como tu dedo. Se ha simplificado al mximo y a pesar de ello dispone de una pantalla panormica de 13,3 pulgadas, de un teclado completo y de un amplio trackpad multi-touch. Porttil al 100%, te evitar tener que hacer un compromiso en lo que concierne a la pantalla y al teclado.  <br /> <br /> La increble sutileza de MacBook Air es el resultado de un gran nmero de innovaciones en materia de reduccin de tamao y peso. Desde un disco duro ms fino hasta puertos E/S disimulados hbilmente pasando por una batera ms plana, cada detalle se consider para que el resultado fuera lo ms fino posible.<br /> <br /> MacBook Air fue creado y elaborado para disfrutar plenamente del mundo inalmbrico. Un mundo en el que la norma Wi-Fi 802.11n es tan rpida y accesible que permite liberarse completamente de cualquier atadura para comprar videos en lnea, descargar programas, almacenar y compartir archivos en la Red.</p>', '<p>MacBook Air es ultra fino, ultra porttil y ultra diferente de todo el resto. Pero no se pierden kilos y centmetros en tan solo una noche. Todo esto es el resultado de un nuevo invento de normas. De un sinfn de novedades sin cable. Y de una revolucin en el diseo. Con MacBook Air, la informtica mvil adquiere una nueva dimensin.</p>', 'macbook-air', '', '', '', 'MacBook Air', 'Disponible', '');
INSERT INTO `ps_product_lang` VALUES ('10', '4', '<p>MacBook Air ist kaum dicker als Ihr Zeigefinger. Nahezu jedes Detail wurde abgeflacht. Und dabei hat es immer noch einen 13,3-Zoll-Widescreen-LED-Display, eine Tastatur in voller Gre und einen groen Multi-Touch-Trackpad. Es besitzt eine unvergleichliche Tragbarkeit, ohne die blichen Kompromisse fr ultraportable Bildschirme und Tastaturen.</P>Der unglaublich dnne MacBook Air ist das Ergebnis zahlreicher Innovationen zur Gren- und Gewichtsoptimierung. Die flachere Festplatte, die strategisch versteckten I/O-Ports und eine noch flachere Batterie: Alles wurde immer wieder berdacht, immer mit dem Ziel, es noch dnner zu gestalten.</P>Das Design und Konzept von MacBook Air ist voll auf die Vorteile der Kabelfreiheit ausgerichtet. Eine Welt, in der 802.11n WLAN heutzutage so schnell und so leicht verfgbar ist, dass die Menschen heute grenzenlos Filme online kaufen oder mieten, Software downloaden und Dateien ber das Internet teilen oder speichern knnen. </P>', 'MacBook Air is ultrathin, ultraportable, and ultra unlike anything else. But you dont lose inches and pounds overnight. Its the result of rethinking conventions. Of multiple wireless innovations. And of breakthrough design. With MacBook Air, mobile computing suddenly has a new standard.', 'macbook-Air', '', '', '', 'MacBook Air', '', '');
INSERT INTO `ps_product_lang` VALUES ('10', '5', '<p>MacBook Air  sottile quasi come il tuo indice. Praticamente ogni dettaglio  stato semplificato al massimo. Eppure riesce ad avere uno schermo LED di 13,3 pollici, tastiera completa, e un ampio track-pad multi-touch. Incredibilmente portatile, non soffre dei compromessi tra schermo e tastiera.</p><p>La sottigliezza incredibile di MacBook Air  il risultato di moltissime innovazioni nel campo della riduzione di dimensioni e peso. Un hard drive pi sottile, porte I/O strategicamente nascoste, batteria pi piatta: tutto  stato ben calibrato pensando sempre alla sottigliezza.</p><p>MacBook Air  stato progettato e realizzato per godere a pieno dell\'universo del wireless. In un mondo in cui la norma 802.11n Wi-Fi  ormai rapida e disponibile, le persone vivono connesse -  acquistano e noleggiano film online,  scaricano programmi, condividono e conservano file nel web. </p>', 'MacBook Air  ultra-piatto, ultra-portatile, e ultra come nient\'altro al mondo.  Ma non si perdono chili e centimetri in una notte. E\' il risultato di una rielaborazione degli standard. Di moltissime innovazioni sul wireless. E di un design rivoluzionario. Con MacBook Air, l\'informatica mobile acquista una nuova dimensione.', 'macbook-air', '', '', '', 'MacBook Air', '', '');
